import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 1280,
    marginTop: theme.spacing(3),
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  card: {
    height: 250,
    width: '100%',
    maxWidth: 350,
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  content: {
    height: '100%',
  },
  titulo: {
    color: '#303f9f',
    textAlign: 'center',
  },
  subtitulo: {
    color: 'gray',
    textAlign: 'center',
  },
  registro: {
    display: 'flex',
    width: '100%',
    height: '100%',
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: 'column',
  },
  iconreg: {
    fontSize: 80,
  },
  labelreg: {
    color: 'gray',
    textTransform: 'uppercase',
    textAlign: 'center',
    marginTop: theme.spacing(3),
  },
  modal: {
    width: 400,
    height: 400,
    maxWidth: '100%',
  },
  input: {
    width: '100%',
  },
  lista: {
    marginTop: theme.spacing(2)
  }
}))
